import React from 'react';

export default class Clients extends React.Component {
  render() {
    return (
      <div class="main_clients">
				<div>
					<img src="1.png" />
				</div>
				<div>
					<img src="2.png" />
				</div>
				<div>
					<img src="3.png" />
				</div>
				<div>
					<img src="4.png" />
				</div>
				<div>
					<img src="5.png" />
				</div>
			</div>
    );
  }
}
